#include <string>
#include <vector>
#include <algorithm>
#include <sstream>
#include <cmath>
#include <cstdio>
#include <cstdlib>
#include <set>
#include <map>
#include <queue>
using namespace std;
 
#define si size()
typedef vector<int> vi;
typedef vector<string> vs;
typedef long long ii;
#define rev(A) reverse((A).begin(), (A).end())
#define s(A) sort((A).begin(), (A).end())
 
//----------------------------
 
class Decipher {
  public:
  vector <string> decipher(vector <string> a, string b) {
    map<char, int> foo;
    for (int i = 0; i < a.si; i++) {
      for (int j = 0; j < a[i].si; j++) {
        if (a[i][j] != ' ') foo[a[i][j]]++;
      }
    }
    vector<pair<int,char> > X;
    for (map<char,int>::iterator i = foo.begin(); i != foo.end(); ++i) {
      X.push_back(make_pair(-i->second, i->first));
    }
    s(X);
    map<char,char> rev;
    for (int i = 0; i < X.size(); i++) rev[X[i].second] = b[i];
    for (int i = 0; i < a.si; i++) {
      for (int j = 0; j < a[i].si; j++) {
        if (a[i][j] != ' ') a[i][j] = rev[a[i][j]];
      }
    }
    return a;
  }
};
 
